# 4.3 Empirical Strategy 

The baseline identification strategy of this research exploits the participation status in the TPPS, inclusive of 47006 households across diverse regions in China. Given that the dependant variable, IFMP, is a dummy variable, employing a linear regression model would violate a key Gauss-Markov assumption, likely leading to heteroscedasticity in the model.

Consequently, following the research of Alkire and Fang (2019) and Liu et al. (2023), the research opts for a panel logit model to analyse the impact of TPPS on IFMP. However, unlike the random effects models employed in their studies, this work adopts a two-way fixed effects model (TWFE). The TWFE model can control for factors that are invariant over time and factors that are invariant across space, thereby mitigating the endogeneity issues that arise from omitted variables. With the advancement of econometrics, the use of fixed effects models has increasingly surpassed that of random effects models.

$$
\begin{gathered}
I F M P_{i t}=\alpha_{0}+\beta S\left(T P P S_{i t}\right)+X_{i t} \theta+\eta_{i}+\tau_{t}+\varepsilon_{i t} \\
I F M P_{i t}=\alpha_{0}+\beta_{1} T P P S_{-} 1_{i t}+\beta_{2} T P P S_{-} 2_{i t}+\beta_{3} T P P S_{-} 3_{i t}+X_{i t} \theta+\eta_{i}+\tau_{t}+\varepsilon_{i t}
\end{gathered}
$$

Where IFMP represents the MP status for household $i$, at time $t$. TPPS_1 , TPPS_2 and TPPS_3 refers to the dummy variable for the state social insurance, enterprise annuity and individual commercial insurance participation of household $i$, in the pillar $n$, at time $t$. This binary indicator equals one if household engages in TPPS, and zero otherwise. The ordinal variable $S(T P P S)$ measures the degree of the TPPS participation from 0 (exclusion from TPPS) to 3 (full involvement in TPPS). Based on its control for the fixed effects of region (provincial $\eta$ ) and time (year $\tau$ ), TWFE model tackles endogeneity, isolates omitted variable bias, and therefore enhance the explainability of this research. This specification includes the control variables ( $X$ ) from the aspects of households. $\varepsilon$ represents the cluster-robust standard errors.
